<template>
  <div>
    <style>
      #canvas1 {
        position: absolute;
        top: 0;
        left: 0;
        width: 100%;
        height: 100%;
      }
    </style>
    <div
      class="p-10 bg-gradient-to-b from-slate-900 to-slate-800 w-screen min-h-screen"
    >
      <canvas id="canvas1" class="w-full z-2"></canvas>
      <PageHeader />
      <div class="grid grid-cols-8 m-5 p-5 gap-3 z-1">
        <h1 class="col-span-8 col-start-6 text-slate-200 text-4xl z-0">
          Particle Distortion
        </h1>
        <h2 class="col-span-8 col-start-7 text-slate-200 text-lg z-0">
          Reload the page once to see the image.
        </h2>
      </div>
    </div>
  </div>
</template>

<script>
export default {
  name: 'ImageParticles',
  data: () => ({}),
  mounted() {
    /** @type {HTMLCanvasElement} */
    const canvas = document.getElementById('canvas1')
    const ctx = canvas.getContext('2d')
    canvas.width = window.innerWidth
    canvas.height = window.innerHeight
    let particleArray = []

    // mouse
    const mouse = {
      x: null,
      y: null,
      radius: 100,
    }

    window.addEventListener('mousemove', function (event) {
      mouse.x = event.x + canvas.clientLeft / 2
      mouse.y = event.y + canvas.clientTop / 2
    })

    function drawImage() {
      const imageWidth = png.width
      const imageHeight = png.height
      const data = ctx.getImageData(0, 0, imageWidth, imageHeight)
      ctx.clearRect(0, 0, canvas.width, canvas.height)

      // noinspection CommaExpressionJS
      class Particle {
        constructor(x, y, color, size) {
          // eslint-disable-next-line no-unused-expressions,no-sequences
          ;(this.x = x + canvas.width / 2 - png.width * 2),
            (this.y = y + canvas.height / 2 - png.height * 2),
            (this.color = color),
            (this.size = 1.5),
            (this.baseX = x + canvas.width / 2 - png.width * 2),
            (this.baseY = y + canvas.height / 2 - png.height * 2),
            (this.density = Math.random() * 100 + 2)
        }

        draw() {
          ctx.beginPath()
          ctx.arc(this.x, this.y, this.size, 0, Math.PI * 2)
          ctx.closePath()
          ctx.fill()
        }

        update() {
          ctx.fillStyle = this.color

          // collision detection
          const dx = mouse.x - this.x
          const dy = mouse.y - this.y
          const distance = Math.sqrt(dx * dx + dy * dy) / 2
          const forceDirectionX = dx / distance
          const forceDirectionY = dy / distance

          // max distance, past that the force will be 0
          const maxDistance = 100
          let force = (maxDistance - distance) / maxDistance
          if (force < 0) force = 0

          const directionX = forceDirectionX * force * this.density * 0.6
          const directionY = forceDirectionY * force * this.density * 0.6

          if (distance < mouse.radius + this.size) {
            this.x -= directionX
            this.y -= directionY
          } else {
            if (this.x !== this.baseX) {
              const dx = this.x - this.baseX
              this.x -= dx / 20
            }
            if (this.y !== this.baseY) {
              const dy = this.y - this.baseY
              this.y -= dy / 20
            }
          }
          this.draw()
        }
      }

      function init() {
        particleArray = []

        for (let y = 0, y2 = data.height; y < y2; y++) {
          for (let x = 0, x2 = data.width; x < x2; x++) {
            if (data.data[y * 4 * data.width + x * 4 + 3] > 128) {
              const positionX = x
              const positionY = y
              const color =
                'rgb(' +
                data.data[y * 4 * data.width + x * 4] +
                ',' +
                data.data[y * 4 * data.width + x * 4 + 1] +
                ',' +
                data.data[y * 4 * data.width + x * 4 + 2] +
                ')'
              particleArray.push(
                new Particle(positionX * 4, positionY * 4, color)
              )
            }
          }
        }
      }

      function animate() {
        requestAnimationFrame(animate)
        ctx.fillStyle = 'rgba(0, 0, 0, 0.9)'
        ctx.fillRect(0, 0, innerWidth, innerHeight)

        for (let i = 0; i < particleArray.length; i++) {
          particleArray[i].update()
        }
      }

      init()
      animate()

      window.addEventListener('resize', function () {
        canvas.width = innerWidth
        canvas.height = innerHeight
        init()
      })
    }

    const png = new Image()
    png.src =
      'data:image/png;base64,'
    // png.src = "data:image/png;base64,";
    // png.src = "data:image/png;base64,";
    window.addEventListener('load', (event) => {
      console.log('page has loaded')
      ctx.drawImage(png, 0, 0)
      drawImage()
    })
  },
  methods: {},
}
</script>
